webpackJsonp([0x6e14eeafa2af],{4945:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"",date:"29 Sep 2006",slug:"/2006-09-29-auslanderkarte-dont-leave-home-without-it/",tags:"Y2006"},html:'<p>Yesterday the German Interior Ministry announced the introduction of a <a href="http://www.spiegel.de/politik/deutschland/0,1518,439937,00.html" title="Ausweise: Innenministerium plant elektronische \'Ausländerkarte\' - Politik - SPIEGEL ONLINE - Nachrichten">personal id card for foreign residents</a>, an <em>Aufenthaltskarte</em> similar the the <em>Personalausweis</em> issued to German citizens. I\'m not so hot about all my personal data on a digitally readable smart card, but it will be practical to be able to leave my passport at home when I want to <a href="http://www.papascott.de/archives/2005/11/04/things-an-american-cant-do-in-germany-get-a-official-id-card/">buy a phone or rent a video</a>.</p>'},next:{fields:{title:"Starbucks Too Late",date:"27 Sep 2006",slug:"/2006-09-27-starbucks-too-late/"}},previous:{fields:{title:"Germany Invaded By Giant Insect",date:"29 Sep 2006",slug:"/2006-09-29-germany-invaded-by-giant-insect/"}}},{node:{fields:{title:"Starbucks Too Late",date:"27 Sep 2006",slug:"/2006-09-27-starbucks-too-late/",tags:"Y2006"},html:'<p><img src="http://www.papascott.de/wordpress/wp-content/uploads/2006/09/starbucks_rathausmarkt_hh.jpg" alt="Starbucks Rathausmarkt HH" /></p>\n<p>Starbucks has <a href="http://www.ankegroener.de/?p=1688">finally arrived in Hamburg</a>, about a decade too late (photo stolen from Anke Gröner, I hope she doesn\'t mind... it\'s not like I ever get to downtown anymore).</p>'},next:{fields:{title:"Water Slide",date:"26 Sep 2006",slug:"/2006-09-26-water-slide/"}},previous:{fields:{title:"",date:"29 Sep 2006",slug:"/2006-09-29-auslanderkarte-dont-leave-home-without-it/"}}},{node:{fields:{title:"Water Slide",date:"26 Sep 2006",slug:"/2006-09-26-water-slide/",tags:"Y2006"},html:'<p><a href="http://www.flickr.com/photos/papascott/252395484/" title="Photo Sharing"><img src="http://static.flickr.com/112/252395484_a3c5eafb31.jpg" width="500" height="375" alt="25092006066" /></a></p>\n<p>Yesterday could be the last nice sunny day we have this year, so I took Christopher back to Planten un Blomen in the afternoon, this time with his swimming suit. I sat on the sidelines and read Bloglines Mobile.</p>\n<p><a href="http://www.flickr.com/photos/papascott/252396302/" title="Photo Sharing"><img src="http://static.flickr.com/80/252396302_6ff2e47732.jpg" width="500" height="375" alt="25092006067" /></a></p>\n<p>We were there 3 hours, I hope he was tired out.</p>'},next:{fields:{title:"OpenBC to become Xing",date:"25 Sep 2006",slug:"/2006-09-25-openbc-to-become-xing/"}},previous:{fields:{title:"Starbucks Too Late",date:"27 Sep 2006",slug:"/2006-09-27-starbucks-too-late/"}}}],pathPrefix:"",first:!1,last:!1,index:188,pageCount:1101}}}});
